import React from 'react';
import Header from './Components/Header/';
import { Grid } from '@material-ui/core';
import { LOCALES, I18Provider } from './i18n';

function App() {
  return (
    <I18Provider locale={LOCALES.ENGLISH}>
      <Grid container>
        <Grid item md={12}>
          <Header />
        </Grid>
      </Grid>
    </I18Provider>
  );
}

export default App;
